import React,{useState} from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';
import icon11 from './images/icon1.png';
import icon12 from './images/icon21.png';
import Grid from '@material-ui/core/Grid';
import { Card, CardMedia, CardContent, CardActions, IconButton,CardHeader,Avatar } from '@material-ui/core';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import './style.css';

const cat1='Shoes';
const cat2='Flip-flops';

const products=[
  {category:'Shoes',name:'Shoes 1',description:'Running shoes',price:'500'},
  {category:'Flip-flops',name:'Flip-flops 1',description:'Comfortable Flip-flops',price:'500'},
  {category:'Shoes',name:'Shoes 2',description:'Running shoes',price:'500'},
  {category:'Flip-flops',name:'Flip-flops 2',description:'Comfortable Flip-flops',price:'500'},
  {category:'Shoes',name:'Shoes 3',description:'Running shoes',price:'500'},
  {category:'Flip-flops',name:'Flip-flops 3',description:'Comfortable Flip-flops',price:'500'},
  {category:'Shoes',name:'Shoes 4',description:'Running shoes',price:'500'},
  {category:'Flip-flops',name:'Flip-flops 4',description:'Comfortable Flip-flops',price:'500'},
  {category:'Shoes',name:'Shoes 5',description:'Running shoes',price:'500'},
  {category:'Flip-flops',name:'Flip-flops 5',description:'Comfortable Flip-flops',price:'500'},

]

const Home = () => {

  const [category, setCategory] = useState(cat1);

  const getProductsInCategory = () => {
    return products.filter(
      (product) => product.category === category
    );
  };

  return (
    <div>
        <Navbar1/>
        <div className="container2">
        <div className="menu">
            <img  src={icon11}/>
      </div>
      <div className="devices">
        <div className="device1">
          <h3>Devices</h3>
          <Link to='/add_phone_number'  className="link2">
            <Button className="button5" variant="outlined" ><span> +1&nbsp;Add Device</span></Button>
          </Link>
        </div>
        <div className="grid1"><Grid container justify="center" spacing={4}>
        {getProductsInCategory().map((product, idx) => (
          <div className="device2" key={idx}>
            <Card style={{ width: '15rem' }}>
            <CardHeader
        avatar={
          <Avatar className="avatar">
            pH
          </Avatar>
        }
        action={
          <IconButton aria-label="settings">
            <MoreVertIcon />
          </IconButton>
        }
        title="pH Sensor 1"
      />
                <CardContent>
                  <div style={{display: 'flex',justifyContent:'space-between',}}>
                    <h2>{product.name}</h2>
                    <h2>${product.price}</h2>
                  </div>
                  <p>{product.description}</p>
                </CardContent>
                <CardActions disableSpacing style={{display: 'flex',justifyContent:'flex-end',}}>
                </CardActions>
            </Card>
          </div>
          
        ))}
        </Grid></div>
      </div>
        <div className="analytics">
            <p>fegrd</p>
        </div>
        </div>
    </div>
  );
};

export default Home;
